#### Arbeitsräume

Die lichte Raumhöhe und die Bodenfläche müssen aus den Plänen ersichtlich sein. Bei unterirdischen Arbeitsräumen müssen ausserdem die Höhe von Böschungen, Abgrabungen und Brüstungen in den Plänen ersichtlich sein.", "fr": ""}

{"de": "---

#### Ausgänge, Fluchtwege

Die Lage der Treppenhäuser, die zusätzlichen Ausgänge und Fluchtwege, die Laufbreite der Treppen sowie die Art und Drehrichtung der Türen müssen in den Plänen ersichtlich sein.", "fr": ""}

